{
	struct Scene *_self;
	const char* name;
	struct KeyingSet *keyingset;
	char *_data, *_retdata;
	
	_self= (struct Scene *)_ptr->data;
	_data= (char *)_parms->data;
	name= *((const char**)_data);
	_data+= 4;
	_retdata= _data;
	
	keyingset= rna_Scene_keying_set_new(_self, reports, name);
	*((struct KeyingSet**)_retdata)= keyingset;
}

